import React from "react";

const Campaign = () => {
  return (
    <section className="prelaunch" id="campaign">
      <div className="container">
        <div className="row">
          <div className="col-md-12">
            <div className="prelaunch-sec text-center">
              <h2>Prelunch Campaign</h2>
              <button className="btn btn-success">Read More</button>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Campaign;
